// material-ui

import {
    Drawer,
    Fab,
    FormControl,
    FormControlLabel,
    Grid,
    IconButton,
    Radio,
    RadioGroup,
    Slider,
    Tooltip,
    Typography
} from '@mui/material';
// project imports
import MainCard from 'ui-component/cards/MainCard';

// ==============================|| SAMPLE PAGE ||============================== //

const Plans = () => (
    <Grid container spacing={24}>
        <Grid item xs={12}>
            <MainCard title="Plans">
                <Typography variant="body2">This is where background selection will go</Typography>
            </MainCard>
        </Grid>
    </Grid>
);

export default Plans;
